import Layout from '../components/Layout'
import ActionButton from '../components/Button'
import ImageRound from '../components/ImageRound'
import LinkedInIcon from '@material-ui/icons/LinkedIn';

import benny from '../images/benny.jpg'

const Index = () => {

    return (
        <div className="content">
            <h1>Benjamin Killer</h1>
            <ImageRound src={benny} alt="Benjamin Killer" />
            <div><LinkedInIcon target="_blank" href="www.linkedin.com/in/benjamin-killer" /><a >LinkedIn</a></div>
            <style jsx>{`
                .content {
                    display: flex;
                    flex: 1 1 auto;
                    align-items: center;
                    flex-direction: column;
                    justify-content: center;
                }
            `}</style>
        </div>
    )
}

export default Layout(Index)
